      function Create_Icons() {
        myPng = [];
        for (var i = 0; i < icons_array.length; i = i + 1) {
          myPng[i] = new File(
            Folder.userData.toString() +
              "/Motioneer/Icons//Image_" +
              i +
              ".png",
          );
          myPng[i].encoding = "BINARY";
          myPng[i].open("w");
          myPng[i].write(icons_array[i]);
          myPng[i].close();
        }
      }
      function Check_Folder(presets_folder) {
        if (presets_folder.exists) {
          if (icons_folder.exists) {
            var icons_num = icons_folder.getFiles();
            if (
              icons_num.length == null ||
              icons_num.length != icons_array.length
            ) {
              Create_Icons();
            }
          } else {
            icons_folder.create();
            Create_Icons();
          }
        } else {
          var createFolder = presets_folder.create();
          if (presets_folder.exists) {
            icons_folder.create();
            Create_Icons();
          } else {
            var error_num = 0;
            Alert_Errors(error_num);
          }
        }
        return presets_folder.toString();
      }
