                  var t_out = [];
                  var key_vertices = key_value.vertices;
                  var key_t_in = key_value.inTangents;
                  var key_t_out = key_value.outTangents;
                  for (var av = 0; av < key_vertices.length; av += 1) {
                    v[av] = key_vertices[av];
                    t_in[av] = key_t_in[av];
                    t_out[av] = key_t_out[av];
                    if (inv_x) {
                      v[av][0] = w / 2 + (key_vertices[av][0] - w / 2) * -1;
                      t_in[av][0] = key_t_in[av][0] * -1;
                      t_out[av][0] = key_t_out[av][0] * -1;
                    }
                    if (inv_y) {
                      v[av][1] = h / 2 + (key_vertices[av][1] - h / 2) * -1;
                      t_in[av][1] = key_t_in[av][1] * -1;
                      t_out[av][1] = key_t_out[av][1] * -1;
                    }
                  }
                  key_value.vertices = v;
                  key_value.inTangents = t_in;
                  key_value.outTangents = t_out;
                  mask_shape.setValueAtTime(key_time, key_value);
                  lr_mask_shape.setValueAtTime(key_time, key_value);
