        if (app.project.activeItem.selectedLayers.length > 0) {
          var selected_layer = app.project.activeItem.selectedLayers[0];
          var trans = selected_layer.property("ADBE Transform Group");
          var count = -1;
          for (var ap = 0; ap < 12; ap += 1) {
            var prop = trans.property(ap + 1);
            var exp = prop.expression;
            var string = exp.split("\n");
            for (var ar = 0; ar < string.length; ar += 1) {
              var row = string[ar].toString();
              if (row.indexOf("//") > -1) {
                count++;
                if (ap == 2) {
                  if (selected_layer.threeDLayer) {
                    count = count - 2;
                  } else {
                    count = count - 1;
                  }
                }
                if (ap == 7) {
                  count = count - 2;
                }
              }
            }
          }
          if (count == effects_list.items.length) {
            check_effects = true;
          }
        }
        return check_effects;
