      function Add_Images(type) {
        if (type == "list") {
          var items = effects_list.items;
        } else {
          if (type == "add") {
            var items = effects_list.items;
          }
        }
        for (var aa = 0; aa < items.length; aa += 1) {
          var string = items[aa].text.split(" ");
          var name = string[0];
          var fx_prop = string[1];
          if (name == "Bounce") {
            if (fx_prop == "Position") {
              items[aa].image = p_image;
            } else {
              if (fx_prop == "Scale") {
                items[aa].image = s_image;
              } else {
                if (fx_prop == "Rotate") {
                  items[aa].image = r_image;
                }
              }
            }
          } else {
            if (name == "Wiggle") {
              if (fx_prop == "Position") {
                items[aa].image = p_image;
              } else {
                if (fx_prop == "Scale") {
                  items[aa].image = s_image;
                } else {
                  if (fx_prop == "Rotate") {
                    items[aa].image = r_image;
                  } else {
                    if (fx_prop == "Opacity") {
                      items[aa].image = o_image;
                    }
                  }
                }
              }
            } else {
              if (name == "Circle") {
                items[aa].image = p_image;
              } else {
                if (name == "Stretch") {
                  if (fx_prop == "Scale") {
                    items[aa].image = s_image;
                  } else {
                    if (fx_prop == "Rotate") {
                      items[aa].image = r_image;
                    }
                  }
                } else {
                  if (name == "Squash") {
                    items[aa].image = s_image;
                  }
                }
              }
            }
          }
        }
      }
      function Effects_List() {
        if (
          app.project.activeItem != null &&
          app.project.activeItem.selectedLayers.length > 0
        ) {
          var sel_layers = app.project.activeItem.selectedLayers;
          if (sel_layers.length > 0) {
            if (sel_layers.length > 1) {
              effects_list.removeAll();
            } else {
              effects_list.removeAll();
              var selected_layer = sel_layers[0];
              var trans = selected_layer.property("ADBE Transform Group");
              var masks = selected_layer.property("ADBE Mask Parade");
              var items_names = [];
              for (var ap = 0; ap < 12; ap += 1) {
                var prop = trans.property(ap + 1);
                var exp = prop.expression.toString();
                if (exp.length > 0) {
                  var string = exp.split("\n");
                  for (var ar = 0; ar < string.length; ar += 1) {
                    var row = string[ar].toString();
                    if (
                      row.indexOf("//") > -1 &&
                      row.indexOf("// Value") <= -1
                    ) {
                      var name = row.split(" ")[1].toString();
                      var fx_prop = row.split(" ")[2].toString();
                      var fx_num = row
                        .split(" ")[3]
                        .toString()
                        .replace("\r", "");
                      var row_parameters = eval(string[ar + 2]);
                      if (fx_prop == "Position") {
                        if (ap == 1) {
                          effects_list.add(
                            "item",
                            name + " " + fx_prop + " " + fx_num,
                          );
                        } else {
                          if (ap == 2) {
                            effects_list.add(
                              "item",
                              name + " " + fx_prop + " " + fx_num,
                            );
                          }
                        }
                      } else {
                        if (fx_prop == "Rotate") {
                          if (ap == 9) {
                            effects_list.add(
                              "item",
                              name + " " + fx_prop + " " + fx_num,
                            );
                          }
                        } else {
                          effects_list.add(
                            "item",
                            name + " " + fx_prop + " " + fx_num,
                          );
                        }
                      }
                    }
                  }
                  if (effects_list.items.length > 0) {
                    var item_name =
                      effects_list.items[effects_list.items.length - 1].text;
                    anim_name = name + " " + fx_prop + " " + fx_num;
                    if (item_name == anim_name) {
                      if (row_parameters[0]) {
                        if (item_name.indexOf("OFF - ") > -1) {
                        }
                      } else {
                        effects_list.items[effects_list.items.length - 1].text =
                          "OFF - " + item_name;
                        if (item_name.indexOf("OFF - ") <= -1) {
                        }
                      }
                    }
                  }
                }
              }
              Add_Images("list");
            }
          }
        } else {
          effects_list.removeAll();
          Remove_Edit_Grp();
        }
      }
