      function Ease(ease_value, type) {
        if (app.project.activeItem != null) {
          if (type == "in") {
            app.beginUndoGroup("Edit Keys Ease In");
            for (
              var al = 0;
              al < app.project.activeItem.selectedLayers.length;
              al += 1
            ) {
              for (
                var ap = 0;
                ap <
                app.project.activeItem.selectedLayers[al].selectedProperties
                  .length;
                ap += 1
              ) {
                if (
                  app.project.activeItem.selectedLayers[al].selectedProperties[
                    ap
                  ].canVaryOverTime
                ) {
                  for (
                    var ak = 0;
                    ak <
                    app.project.activeItem.selectedLayers[al]
                      .selectedProperties[ap].selectedKeys.length;
                    ak += 1
                  ) {
                    var prop =
                      app.project.activeItem.selectedLayers[al]
                        .selectedProperties[ap];
                    var ease_in = new KeyframeEase(0, ease_value);
                    var ease_out = new KeyframeEase(
                      prop.keyOutTemporalEase(prop.selectedKeys[ak])[0].speed,
                      prop.keyOutTemporalEase(prop.selectedKeys[ak])[0]
                        .influence,
                    );
                    if (!prop.isSpatial && prop.value.length == 3) {
                      prop.setTemporalEaseAtKey(
                        prop.selectedKeys[ak],
                        [ease_in, ease_in, ease_in],
                        [ease_out, ease_out, ease_out],
                      );
                    } else {
                      if (!prop.isSpatial && prop.value.length == 2) {
                        prop.setTemporalEaseAtKey(
                          prop.selectedKeys[ak],
                          [ease_in, ease_in],
                          [ease_out, ease_out],
                        );
                      } else {
                        prop.setTemporalEaseAtKey(
                          prop.selectedKeys[ak],
                          [ease_in],
                          [ease_out],
                        );
                      }
                    }
                  }
                }
              }
            }
            app.endUndoGroup();
          } else {
            if ((type = "out")) {
              app.beginUndoGroup("Edit Keys Ease Out");
              for (
                var al = 0;
                al < app.project.activeItem.selectedLayers.length;
                al += 1
              ) {
                for (
                  var ap = 0;
                  ap <
                  app.project.activeItem.selectedLayers[al].selectedProperties
                    .length;
                  ap += 1
                ) {
                  if (
                    app.project.activeItem.selectedLayers[al]
                      .selectedProperties[ap].canVaryOverTime
                  ) {
                    for (
                      var ak = 0;
                      ak <
                      app.project.activeItem.selectedLayers[al]
                        .selectedProperties[ap].selectedKeys.length;
                      ak += 1
                    ) {
                      var prop =
                        app.project.activeItem.selectedLayers[al]
                          .selectedProperties[ap];
                      var ease_out = new KeyframeEase(0, ease_value);
                      var ease_in = new KeyframeEase(
                        prop.keyInTemporalEase(prop.selectedKeys[ak])[0].speed,
                        prop.keyInTemporalEase(prop.selectedKeys[ak])[0]
                          .influence,
                      );
                      if (!prop.isSpatial && prop.value.length == 3) {
                        prop.setTemporalEaseAtKey(
                          prop.selectedKeys[ak],
                          [ease_in, ease_in, ease_in],
                          [ease_out, ease_out, ease_out],
                        );
                      } else {
                        if (!prop.isSpatial && prop.value.length == 2) {
                          prop.setTemporalEaseAtKey(
                            prop.selectedKeys[ak],
                            [ease_in, ease_in],
                            [ease_out, ease_out],
                          );
                        } else {
                          prop.setTemporalEaseAtKey(
                            prop.selectedKeys[ak],
                            [ease_in],
                            [ease_out],
                          );
                        }
                      }
                    }
                  }
                }
              }
              app.endUndoGroup();
            }
          }
          app.beginUndoGroup("Edit Keys Linear");
          for (
            var al = 0;
            al < app.project.activeItem.selectedLayers.length;
            al += 1
          ) {
            for (
              var ap = 0;
              ap <
              app.project.activeItem.selectedLayers[al].selectedProperties
                .length;
              ap += 1
            ) {
              if (
                app.project.activeItem.selectedLayers[al].selectedProperties[ap]
                  .canVaryOverTime
              ) {
                for (
                  var ak = 0;
                  ak <
                  app.project.activeItem.selectedLayers[al].selectedProperties[
                    ap
                  ].selectedKeys.length;
                  ak += 1
                ) {
                  var prop =
                    app.project.activeItem.selectedLayers[al]
                      .selectedProperties[ap];
                  var ease_in = prop.keyInTemporalEase(prop.selectedKeys[ak])[0]
                    .influence;
                  var ease_out = prop.keyOutTemporalEase(
                    prop.selectedKeys[ak],
                  )[0].influence;
                  if (ease_in <= 0.1 && ease_out <= 0.1) {
                    prop.setInterpolationTypeAtKey(
                      prop.selectedKeys[ak],
                      KeyframeInterpolationType.LINEAR,
                    );
                  }
                }
              }
            }
          }
          app.endUndoGroup();
        }
      }
